function UseStateBasics () {

 const [title , setTitle] = useState("RRR")

 const [backGround , setBackGround] = useState("backgroud-white")

function changeTitle () {
    setBackGround("backgroud-yellow")
}


  return <div className="box-container">
     <h1>use state basics</h1>
     <div onClick={changeTitle} className={backGround} >{title}</div>
      </div>

}

export default UseStateBasics;
